from django.test import TestCase
from django.test import Client
from classify.views import Bbox

base64img = ''
valid_header  = {'HTTP_TOKEN':'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJhdWQiOiIxMzIyMjIifQ.LmQkgDkXXhNlqe5H_LlX6rWBCKkFUrDw7oMcGfNY8JQ'}
invalid_header = {'HTTP_TOKEN':'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJhdWQiOiIxMzIyMjIifQ.LmQkgDkXXhNlqe5H_LlX6rWBCKkFUrDw7oMcGfNY8JJ'}

class DjangoBackendTest(TestCase):
    def test_rest_server(self):
        client = Client()
        self.assertEqual(client.post('/classify/',{'img':base64img},).content,b'INVALID REQUEST.')
        self.assertEqual(client.post('/classify/',{'tel':'101'}).content,b'INVALID REQUEST.')
        self.assertEqual(client.post('/classify/', {'img': base64img,'tel':'101'},**invalid_header).content,b'FAILED IN TOKEN AUTHORIZATIAN')

    def test_Bbox(self):
        bbox1 = Bbox(5,5,5,5,0)
        bbox2 = Bbox(0,0,5,5,0)
        bbox3 = Bbox(1,1,5,5,0)
        bbox4 = Bbox(2,2,5,5,0)
        bbox5 = Bbox(0.99,0.99,5,5,0)
        self.assertEqual(bbox1.overlap(bbox2),False)
        self.assertEqual(bbox1.overlap(bbox5), False)
        self.assertEqual(bbox1.overlap(bbox3), True)
        self.assertEqual(bbox1.overlap(bbox4), True)
